import React, { Suspense } from 'react';
import useSWR from 'swr';

const getUsers = url => fetch(url).then(data => data.json());

export const List = () => {
  const { data } = useSWR('https://jsonplaceholder.typicode.com/users', getUsers, {
    suspense: true,
  });
  console.log(data);
  return (
    <Suspense fallback={<div>loading...</div>}>
      <ul>
        {data.map(user => (
          <li key={user.id}>
            Username: {user.username} <br />
            City: {user.address.city} <br />
            Email: {user.email}
          </li>
        ))}
      </ul>
    </Suspense>
  );
};
